export default class Platform{
    constructor(c){
        this.position = {

            x: 200, 
            y: 100
        }
        this.c = c

        this.width = 200
        this.height = 20
    }

    draw(){
        this.c.fillStyle = 'blue'
        this.c.fillRect(this.position.x, this.position.y, this.width, this.height)
    }
}
